def extractor(stringInput: str):
    allNumbers = stringInput.split(",")
    allNumbers = list(map(lambda x: x.replace(" ", ""), allNumbers))
    allNumbers = list(map(lambda x: x.replace("-", ""), allNumbers))
    # print("allNumbers",allNumbers)
    allNumbers[0]="+"+allNumbers[0].split("+")[1]
    allNumbers = list(filter(lambda x: x[0] =="+", allNumbers))
    return allNumbers


